const Loading = () => {
    return ( 
        <div className="container-lg">
            <div id="loading">
                <h3 >در حال بارگذاری اطلاعات </h3>
                <img src={loading} id="loadingImg" />
            </div>
        </div>
     );
}
 
export default Loading;
